import React from 'react';
import {    makeStyles } from '@material-ui/core/styles';
import SearchInput from '../component/SearchInput';
import DataTableBills from '../component/DataTableBills';
import axios from 'axios';
import {BASE_API} from '../constant/index';
import Button from '@material-ui/core/Button';
const useStyles = makeStyles((theme) => ({
    title:{
        paddingTop:'10px'

    }


}));

export default function Bill() {
    const classes = useStyles();
    const [bills,setBills] = React.useState([]);
    React.useEffect(()=>{
        axios.get(`${BASE_API}/bills`)
        .then((reponse)=>{
            console.log(reponse.data);
            setBills(reponse?.data);
        })
        .catch((error)=>{
            console.log(error)
        })
    },[])

    return (
        <div className={classes.search}>
            <h2 className={classes.title}>Bills</h2>
            <div className={classes.button1}>
                <Button className={classes.button} variant="contained" color="primary">Thêm</Button>
                <Button className={classes.button} variant="contained">Sửa</Button>
                <Button className={classes.button} variant="contained" color="secondary">Xóa</Button>
            </div>

            <DataTableBills data={bills}/>
        </div>
    );
}
